        /// <summary>
        /// Check conditional logic where no ctvData is found.
        /// </summary>
        [TestMethod]
        public void CreateDefects_NoCtvData()
        {
            AtomDefect defect_mine = new AtomDefect(0, 0, "000", new Dictionary<string, string>());
            defect_mine.Array = "ic_btb";
            defect_mine.Bank = 0;
            defect_mine.CoreToFailIO = new Dictionary<string, string>
            {
                { "#NonValid", "00000000" },
            };
            defect_mine.Dword = 0;
            defect_mine.FailAddress = "000";
            defect_mine.Module = "0";
            defect_mine.SendToRepair = false;
            var defects = new List<IDefect> { defect_mine };

            var ctvData = new List<string>
            {
            };

            var arrayConfig = this.deserializedRaster.GetLdatArray("ic_btb");

            var currentMBDAddress = new Tuple<int, int, int>(0, 0, 0);
            arrayConfig.MatchAddressToDwordElement(currentMBDAddress, out var dwordElement); // you're not required to assign any variables to a method's return value

            // You're close. If there's not CtvData for a given atomDefect, it becomes Non-valid, and the SendToRepair value becomes false.
            List<IDefect> outcome = AtomDefect.CreateDefects(
                ctvData,
                this.deserializedMetadata.GetCaptureSet("LSA_RASTER_CAPTURE_DECODING_SET_ATOM"),
                this.deserializedMetadata.GetPinMappingSet("ATOM_MOD0"),
                "YY_TAP_TDO_C2S",
                "ic_btb",
                dwordElement);

            Assert.IsFalse(outcome[0].SendToRepair);
        }

