        /// <summary>
        /// Ensure <see cref="AtomDefect"/> adds itself properly to generic data structure.
        /// </summary>
        [TestMethod]
        public void AddToInternalDatabase()
        {
            AtomDefect defect = new AtomDefect(0, 0, "failaddr", new Dictionary<string, string>());
            defect.Array = "ic_btb";
            defect.Bank = 0;
            defect.CoreToFailIO = new Dictionary<string, string>
            {
                { "0", "0101100000000000010101100111000000000000000000000000010110000000" },
            };
            defect.Dword = 0;
            defect.FailAddress = "110000000000";
            defect.Module = "0";
            defect.SendToRepair = true;

            var comparisonDefectsList = new List<IDefect> { defect };
            var database = new Dictionary<string, List<IDefect>> { };
            defect.AddToInternalDatabase(ref database);
            var resultDefectList = database["ic_btb_0"]; // Logic behind this is that the key used should return the list of defects we expect.
            Assert.IsTrue(resultDefectList[0].Equals(comparisonDefectsList[0]));
        }

