        /// <summary>
        /// Test equality method returns correctly when two defects have same values.
        /// </summary>
        [TestMethod]
        public void Equals()
        {
            AtomDefect atomDefect1 = new AtomDefect(0, 0, "failaddr", new Dictionary<string, string>());
            AtomDefect atomDefect2 = new AtomDefect(0, 0, "failaddr", new Dictionary<string, string>());

            atomDefect1.Array = "array";
            atomDefect2.Array = "array";
            atomDefect1.Module = "module";
            atomDefect2.Module = "module";

            Assert.IsTrue(atomDefect1.Equals(atomDefect2));
        }

        /// <summary>
        /// Test that we method generates proper repair string to pass onto iCRepair.
        /// </summary>
        [TestMethod]
        public void CreateRepairString()
        {
            AtomDefect atomDefect1 = new AtomDefect(0, 0, "0101", new Dictionary<string, string>());
            atomDefect1.CoreToFailIO.Add("core0", "0100");

            string output = atomDefect1.CreateRepairString();
            Assert.IsTrue(output == ",,core0,0,0,5,2");
